import persontest from './persontest.jpg'
function Personalinfo() {
    const info = [{ "name": "ck", "id": "1" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" }];

    return (
        <div className="flex flex-row ">
            {Array.from(info).map(entry => {
                return <div className="p-6 max-w-sm  bg-white rounded-xl shadow-lg  items-center grid grid-cols-2">
                    <div className="clo-span-1 gap-2">
                        <table>
                            <tbody>
                                <tr><td>Name: </td><td>{entry.name}</td></tr>
                                <tr><td>ID: </td><td>{entry.id}</td></tr>
                            </tbody>
                        </table>
                    </div>
                    <div className="clo-span-1">
                        <img src='persontest'></img>
                    </div>
                </div>
            })}

        </div>
    );
}
export default Personalinfo;
